import React, { Component } from 'react';
import Head from '../components/Head';
import axios from 'axios';

export default class Classes extends Component {


	constructor(props) {
		super(props);
		this.state = {
			students: [],
			changeStart,
			changeEnd
		}
		axios.get(`/classes`)
			.then(res => {
				this.setState({ students: res.data });
			}).catch(error => {
				console.log(error);
			});
		this.handleBlur = this.handleBlur.bind(this);
		this.handleClick = this.handleClick.bind(this);


	}

	handleBlur(event) {
		console.log(event.target.innerHTML	);
		this.setState({ changeStart: res.data });
	}
	handleClick(event) {
		console.log(event.target.innerHTML);
	}

	render() {
		return (
			<div>
				<Head />
				<div id="body">
					<table>
						<thead>
							<tr>
								<td>name</td>
								<td>password</td>
								<td>class</td>
							</tr>
						</thead>
						<tbody>
							{this.state.students.map((stud)=><tr  key={stud.id}>
								<td contentEditable="true" onBlur={this.handleBlur} onClick={this.handleClick}>{stud.name}</td>
								<td contentEditable="true" onBlur={this.handleBlur} onClick={this.handleClick}>{stud.password}</td>
								<td contentEditable="true" onBlur={this.handleBlur} onClick={this.handleClick}>{stud.class}</td>
							</tr>)}
							</tbody>
					</table>
				</div>
			</div>
		);
	}
}
